import Axios from 'axios';
import { GET_PRODUCTS } from './actionType';
import { URL } from "../common/API";

export const getProducts = () => {
    return dispatch => {
        Axios.get(URL.Login)
        .then(res => {
            dispatch({
              type: GET_PRODUCTS,
              payload: res.data
            });
          })
          .catch(err => {
              dispatch({
                type: GET_PRODUCTS,
                payload: {"error":"Error Connection"}
              });
          });
    }
}

export const login = () => {
  return dispatch => {
      Axios.post(URL.Login, {
        username:'eswar', password: 'eswar'
      })
      .then(res => {
          dispatch({
            type: GET_PRODUCTS,
            payload: res.data
          });
        })
        .catch(err => {
            dispatch({
              type: GET_PRODUCTS,
              payload: {"error":"Error Connection"}
            });
        });
  }
}
